import { useEffect, useState } from 'react'
import "./Gallery.css"

export const PublicGalleryView = () => {

    const [publicPhotos, setPublicPhotos] = useState([])

    useEffect(
        () => {
            fetch(`http://localhost:8088/gallery`)
                .then(response => response.json())
                .then((photoGallery) =>
                setPublicPhotos(photoGallery))
        },
        []
    )


    return (
        <div className="galleryPage">
            <h3 className="galleryHeader">Gallery</h3>
            <div className="gallery" key={`publicPhotos--${publicPhotos.id}`}>
                {
                    publicPhotos.map(photo => {
                        return <div><img className="galleryImg" key={`photo--${publicPhotos.id}`}
                            src={photo.imageURL} />
                        </div>

                    }
                    )
                }
            </div>
        </div>
    )
}
